description:
BLUTGEIL (aka ZURICH COP EATERS) is a zero-budget 20-ish minute short film that apparently caused a stir in it's native country when it reached the public. 

My copy of this film includes a documentary about some court-case that the film-maker was embroiled in due to the content of the film, but honestly - the film itself wasn't notable enough for me to want to watch a documentary about it.
